import React  from "react";

const Resume = () => {
    return (
        <Popup trigger ={<button>Trigger</button>} postion ="right center">
            <iframe src="../Resume/Antonio Resume.pdf" width="100%" height="500px"></iframe>
        </Popup>
    );
};
export default Resume;
